import React from 'react'
import styled from 'styled-components'

const SearchWrapper = styled.div`
  position: relative;
`

const SearchIcon = styled.div`
  position: absolute;
  top: 10;
  left: 0;
`

const Search = styled.input`
  border-radius: 200px;
  background-color: #f5efe5;
  border: none;
  width: 300px;
  padding: 10px 30px;
  margin: 8px;

  &:focus {
    border: none;
  }

  &::placeholder {
    content: 'Search...';
    color: gray;
  }
`

const SearchInput = () => {
  return (
    <SearchWrapper>
      <div></div>
    </SearchWrapper>
  )
}

export default SearchInput
